/* Function to generate random prime (2-1000) */
random_prime() := block([n],
    while true do (
        n: rand(999) + 2,
        if is_prime(n) then return(n)
    )
);

/* Function to generate random composite (4-1000) */
random_composite() := block([n],
    while true do (
        n: rand(997) + 4,
        if not is_prime(n) then return(n)
    )
);

/* Simple prime check */
is_prime(n) := if n < 2 then false else block([result: true],
    for i:2 thru floor(sqrt(n)) do (
        if mod(n, i) = 0 then (result: false, return())
    ),
    result
);

/* Define ALL numbers with their categories - WE KNOW THE ANSWERS! */
prime1: random_prime();
prime2: random_prime();
while prime2 = prime1 do prime2: random_prime();
prime3: random_prime();
while prime3 = prime1 or prime3 = prime2 do prime3: random_prime();

comp1: random_composite();
comp2: random_composite();
while comp2 = comp1 do comp2: random_composite();
comp3: random_composite();
while comp3 = comp1 or comp3 = comp2 do comp3: random_composite();

